INSERT INTO `tb_artikel` (`id_artikel`, `artikel_title`, `artikel_timestamp`, `artikel_thumbnail`, `artikel_text`, `id_category`, `accepted_date`, `artikel_viewer`, `artikel_level`) VALUES (14, 'Laravel', '2024-03-04 08:28:50', '1598502726.jpeg', '<p>Wahh setelah berjuang di SMKCoding dan WDC, kini kamu balik lagi dengan melanjutkan sesi tutorial Laravel 7, namun kami mohon maaf untuk kali ini kami memanfaatkan fitur dari website medium untuk membuat tutorial karena banyaknya kegiatan diluar dugaan..<br />\r\n<br />\r\nPembahasan kali ini adalah structure directory dan migrations. Bermanfaat pastinya buat kalian yang masih beginner dalam programming php dengan framework Laravel<br />\r\n<br />\r\nBtw, makasih yah.. yang udah ucapin congrats buat kami. Semoga sehat selalu ?<br />\r\n<br />\r\nCheck link di bio yah.. ?<br />\r\n<br />\r\nhttps://medium.com/<a href=\"https://www.instagram.com/khusnul20032002/\" tabindex=\"0\">@khusnul20032002</a>/migration-pada-laravel-a9149736bc0d<br />\r\n&nbsp;</p>\r\n', 3, '0000-00-00', 372, 0);
INSERT INTO `tb_artikel` (`id_artikel`, `artikel_title`, `artikel_timestamp`, `artikel_thumbnail`, `artikel_text`, `id_category`, `accepted_date`, `artikel_viewer`, `artikel_level`) VALUES (15, 'Praktek Laravel', '2024-03-01 03:54:38', '1598502781.jpeg', '<p>Framework Laravel adalah sebuah alat bantu untuk memudahkan kita agar bisa lebih mudah saat membuat website, Framework Laravel ini merupakan framework berbasis PHP ( maksutnya Pakek bahasa PHP) yang sedang populer dikalangan programmer PHP setelah CI (CodeIgniter), Rekomendasi banget deh buat kalian yang masih baru masuk ke dalam dunia web programming, buat belajar framework Laravel ini.. .<br />\r\n.<br />\r\nPada seri kali ini kami membuat feed tentang Aplikasi Perpustakaan menggunakan Laravel. Step by step pastinya. Dari instalasi, Layouting, sampai nanti finishing. Jadi.. tetep pantau terus. Walaupun lagi karantina tetep rebahan secukupnya, ngoding selelahnya hehe ?<br />\r\n&nbsp;</p>\r\n', 3, '0000-00-00', 371, 0);
INSERT INTO `tb_artikel` (`id_artikel`, `artikel_title`, `artikel_timestamp`, `artikel_thumbnail`, `artikel_text`, `id_category`, `accepted_date`, `artikel_viewer`, `artikel_level`) VALUES (16, 'Javascript', '2024-03-01 03:55:02', '1598502819.jpeg', '<p>Pada javascript masa sekarang ini terutama pada ES6, asynchronous lebih banyak digunakan oleh pengguna javascript, yah buat kalian yang baru terjun di pemrograman javascript, tidak ada salahnya jika membuat planning untuk mempelajari Asynchronous ini ?<br />\r\n<br />\r\nLet&#39;s code<br />\r\n&nbsp;</p>\r\n', 3, '0000-00-00', 323, 0);
INSERT INTO `tb_artikel` (`id_artikel`, `artikel_title`, `artikel_timestamp`, `artikel_thumbnail`, `artikel_text`, `id_category`, `accepted_date`, `artikel_viewer`, `artikel_level`) VALUES (17, 'Merdeka Belajar di Era New Normal Covid 19', '2024-03-01 03:54:57', '1598764805.jpg', '<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><a class=\"badge badge-primary\" href=\"https://cabdinpasuruan.id/\">#Cabang_Dinas_Pasuruan</a></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Berdasarkan anjuran pemerintah tentang belajar, bekerja dan beribadah dari rumah pada tanggal&nbsp; 16 Maret 2020 sesuai Surat Gubernur Jawa Timur Nomor : 420/1780/101.1/2020, perihal Peningkatan Kewaspadaan terhadap <em>Corona Virus Disease (Covid-19) </em>Jawa Timur, SMK Negeri 1 Purwosari melaksanakan kegiatan belajar mengajar di rumah masing-masing&nbsp; termasuk kegiatan PKL atau prakerin.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Pelaksanaan kegiatan belajar mengajar dengan menggunakan media teknologi informasi internet memunculkan kebiasaan yang baru bagi pendidik dan pelajar. Biasanya siswa dan guru berada dalam ruangan yang sama dan berinteraksi secara langsung, kini siswa dan pendidik diharuskan untuk beradaptasi dengan pembelajaran berbasis <em>digital</em> yang dilakukan di rumah masing-masing, ini memacu para guru untuk lebih mengenal dan mempelajari teknologi informasi serta merancang pembelajaran yang mudah dipahami oleh siswa. Aplikasi&nbsp; yang digunakan pada awal Pendidikan Jarak Jauh (PJJ) yaitu aplikasi<em> Microsoft Teams </em>dan <em>Edmodo </em>tapi, pada saat Tahun ajaran baru 2020-2021 hanya menggunakan Mi<em>crosoft Teams</em>.&nbsp;</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">SMK Negeri 1 Purwosari melakukan perubahan dan penambahan aturan untuk pemberlakuan program Pendidikan Jarak Jauh dengan&nbsp; penjadwalan 1 minggu pertama di isi oleh kegiatan produktif lalu minggu kedua melaksanakan pembelajaran normatif, dalam satu hari maksimal dilakukan 2 pelajaran. Dengan ini, diharapkan siswa-siswi SMK Negeri 1 Purwosari dapat memahami materi lebih baik dan Melakukan 2 kali absensi untuk memastikan siswa selalu hadir di setiap jam pelajaran, link presensi dibagikan melalui grub WhatsApp kelas</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Kebiasaan belajar siswa juga berubah, kini ia diharuskan untuk belajar tanpa diajari secara langsung oleh guru, tanpa terjalin komunikasi secara langsung dengan teman-temannya dan di samping itu ada hambatan lain yaitu beberapa siswa mengalami kekurangan kuota internet dan sinyal yang kurang bagus membuat proses pembelajaran tidak berlangsung dengan optimal.&nbsp;</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Saat memasuki new normal, adapula beberapa protokol kesehatan di lingkungan sekolah yang wajib dipatuhi setiap siswa antara lain; penyemprotan disinfektan yang dilakukan pada saat memasuki gerbang sekolah, pengecekan suhu tubuh setiap siswa, selalu mencuci tangan dengan sabun dan air mengalir pada tempat cuci tangan yang sudah disediakan atau menggunakan hand sanitizer, jaga jarak setiap siswa maksimal 2 meter untuk menghindari kontak antar siswa dan juga siswa diwajibkan selalu memakai masker.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Walaupun masih banyak kekurangan, SMK Negeri 1 Purwosari tetap berusaha mengoptimalkan proses pembelajaran untuk menciptakan penerus bangsa yang cerdas dan berkarakter. Karena SMK Negeri 1 Purwosari mengedapankan siswa yang mandiri dan berprestasi.&nbsp;</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Sejatinya Virus <em>Corona </em>bukanlah penghadang misi dan visi SMK Negeri 1 Purwosari.&nbsp; Dari pembelajaran daring ini siswa lebih mandiri, lebih bisa mencari materi sendiri, lebih kreatif dan lebih menghargai waktu kebersamaan dengan teman-teman mereka.&nbsp;</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Pesan kami, <em>Corona </em>hanya virus yang mampu memisahkan jarak kita. Kita yang terbiasa saling merangkul satu sama lain menjadi duduk berjarak satu meter.&nbsp; Tapi ilmu buta jarak, ilmu bisa menyebar di mana saja, sekalipun di rumah saja. Jangan jadikan <em>corona</em> sebagai penumpul semangat belajar kita. Tetap semangat dan di rumah saja!</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\n<span style=\"font-size:18px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Author Extrakurikuler MCC(Jurnalistik)&nbsp;:<br />\r\n1.&nbsp;Febiana Angga Lestari 12 atph 1<br />\r\n2.&nbsp;Maria Helena Kristianti Wangge 12 atph 3<br />\r\n3.&nbsp;Mukhammad Thoriq Aziz 12 ATPH 2</span></span></p>\r\n', 1, '0000-00-00', 282, 0);
