INSERT INTO `tb_artikel` (`id_artikel`, `artikel_title`, `artikel_timestamp`, `artikel_thumbnail`, `artikel_text`, `id_category`, `accepted_date`, `artikel_viewer`, `artikel_level`) VALUES (43, 'Mengenal Metaverse: Arti, Cara Kerja, dan Opsi Kegiatan di Dalamnya', '2024-03-04 09:44:38', '1680256399.jpg', '<h2 style=\"text-align:center\"><strong>Mengenal Metaverse: Arti, Cara Kerja, dan Opsi Kegiatan di Dalamnya</strong></h2>\r\n\r\n<h2><span style=\"font-size:16px\"><strong>Apa Itu Metaverse?</strong></span></h2>\r\n\r\n<p><a href=\"https://glints.com/id/lowongan/wp-content/uploads/2022/01/metaverse-landscape-glow-800x450-1.jpg\" target=\"_blank\"><img alt=\"metaverse adalah\" src=\"https://glints.com/id/lowongan/wp-content/uploads/2022/01/metaverse-landscape-glow-800x450-1.jpg\" style=\"height:337px; width:600px\" /></a></p>\r\n\r\n<p>&copy; Theverge.com</p>\r\n\r\n<p>Meskipun baru populer belakangan ini,&nbsp;<em>metaverse&nbsp;</em>sejatinya adalah sebuah istilah yang sudah lama diciptakan.</p>\r\n\r\n<p>Ia pertama kali digunakan pada tahun 1992 oleh Neal Stephenson dalam novelnya yang bertajuk &ldquo;Snow Crash&rdquo;.</p>\r\n\r\n<p>Menurut&nbsp;<a href=\"https://www.cnbcindonesia.com/tech/20211216163806-37-299867/mengenal-apa-itu-metaverse-dan-bagaimana-cara-kerjanya\" rel=\"noopener\" target=\"_blank\">CNBC</a>, istilah tersebut merujuk pada dunia virtual berbasis 3D yang dihuni oleh&nbsp;<em>avatar</em>&nbsp;dari pengguna sungguhan.</p>\r\n\r\n<p>Meskipun demikian, makna dari istilah tersebut belum bisa didefinisikan secara universal.</p>\r\n\r\n<p>Sebab, seperti yang sudah Glints paparkan, sejauh ini&nbsp;<em>metaverse&nbsp;</em>masih dalam bentuk konsep.</p>\r\n\r\n<p>Melansir&nbsp;<a href=\"https://time.com/6116826/what-is-the-metaverse/\" rel=\"noopener\" target=\"_blank\">Times</a>, bila ingin didefinisikan, anggap saja&nbsp;<em>metaverse&nbsp;</em>sebagai dunia internet yang dihadirkan dalam bentuk 3D dan virtual.</p>\r\n\r\n<p>Sebagai CEO Meta, Mark Zuckerberg sendiri menggambarkan&nbsp;<em>metaverse</em>&nbsp;sebagai dunia virtual yang bisa dimasuki oleh penggunanya.</p>\r\n\r\n<p>Jadi, alih-alih hanya melihat layar, kamu yang menggunakan&nbsp;<em>metaverse&nbsp;</em>bisa merasakan kehidupan di Meta dengan &ldquo;masuk&rdquo; ke dalam lingkungannya.</p>\r\n\r\n<p>Jika dipersingkat,&nbsp;<em>metaverse&nbsp;</em>merupakan komunitas virtual yang saling terhubung dan tak memiliki ujung.&nbsp;</p>\r\n\r\n<p>Di dalamnya, pengguna dapat bekerja, bersosialisasi, belanja, hingga bermain dengan menggunakan teknologi khusus.</p>\r\n\r\n<p>Beberapa teknologi ini mencakup&nbsp;<em>headset</em>&nbsp;<a href=\"https://glints.com/id/lowongan/virtual-reality-adalah/#.YdQCTWhBzrc\" rel=\"noopener\" target=\"_blank\"><em>virtual reality</em></a>, kacamata&nbsp;<em>augmented reality</em>, serta aplikasi khusus dari&nbsp;<em>smartphone&nbsp;</em>dan atau perangkat lainnya.</p>\r\n\r\n<p>Gambaran sederhana yang diungkapkan oleh Zuckerberg tentang&nbsp;<em>metaverse&nbsp;</em>adalah seperangkat ruang virtual, tempat pengguna bisa membuat dan menjelajah dunia dengan pengguna internet lainnya.</p>\r\n\r\n<p>Pengguna pun tidak perlu berada pada ruang fisik yang sama dengan orang lain. Mereka hanya perlu &ldquo;masuk&rdquo; ke dunia&nbsp;<em>metaverse.</em></p>\r\n\r\n<h2><strong>Apakah Metaverse Hanya untuk Facebook?</strong></h2>\r\n\r\n<p><a href=\"https://glints.com/id/lowongan/wp-content/uploads/2022/01/pexels-felicity-tai-7964200-scaled.jpg\" target=\"_blank\"><img alt=\"metaverse adalah\" src=\"https://glints.com/id/lowongan/wp-content/uploads/2022/01/pexels-felicity-tai-7964200-scaled.jpg\" style=\"height:400px; width:600px\" /></a></p>\r\n\r\n<p>&copy; Pexels.com</p>\r\n\r\n<p>Seperti yang sudah Glints jelaskan,&nbsp;<em>metaverse&nbsp;</em>adalah konsep dunia virtual yang dapat dimanfaatkan masyarakat di masa-masa mendatang.</p>\r\n\r\n<p>Namun, apakah dunia digital ini hanya bisa digunakan untuk pengguna Facebook atau Meta?</p>\r\n\r\n<p>Menurut laman&nbsp;<a href=\"https://www.usatoday.com/story/tech/2021/11/10/metaverse-what-is-it-explained-facebook-microsoft-meta-vr/6337635001/\" rel=\"noopener\" target=\"_blank\">USA Today</a>,&nbsp;<em>metaverse&nbsp;</em>sangatlah penting untuk diperluas agar pengguna bisa menjelajahi dunia secara sungguhan.</p>\r\n\r\n<p>Ia juga harus bekerja sama dengan banyak perusahaan supaya pengguna nanti bisa berinteraksi, belanja, dan berjualan di dalamnya.</p>\r\n\r\n<p>Maka dari itu, Meta kini telah menjalin hubungan kerja sama dengan banyak perusahaan ternama untuk memenuhi dunia&nbsp;<em>metaverse.</em></p>\r\n\r\n<p>Sebagai contoh, perusahaan gim ternama, Epic Games, sudah mengambil peran dan mengumpulkan 1 miliar dolar AS dari investor untuk membantu rencana jangka panjang membangun&nbsp;<em>metaverse</em>.</p>\r\n\r\n<p><em>Brand-brand&nbsp;</em>pakaian kelas dunia seperti Gucci juga sudah melakukan kolaborasi dengan gim Roblox untuk menjual koleksi aksesoris khusus digital dalam&nbsp;<em>metaverse</em>.</p>\r\n\r\n<p>Coca-Cola dan Clinique pun menjual token digital sebagai batu loncatan menuju&nbsp;<em>metaverse.</em></p>\r\n\r\n<p>Pihak Facebook memberikan pernyataan bahwa&nbsp;<em>metaverse</em>&nbsp;bukan produk tunggal yang hanya dapat dibangun oleh satu perusahaan.</p>\r\n\r\n<p>Justru,&nbsp;<em>metaverse</em>&nbsp;adalah produk yang serupa seperti internet. Terlepas dari keberadaan Facebook,&nbsp;<em>metaverse&nbsp;</em>akan tetap ada dan diperluas.</p>\r\n\r\n<h2><strong>Apa Saja yang Bisa Dilakukan dalam Metaverse?</strong></h2>\r\n\r\n<p><a href=\"https://glints.com/id/lowongan/wp-content/uploads/2022/01/1.jpg\" target=\"_blank\"><img alt=\"metaverse adalah\" src=\"https://glints.com/id/lowongan/wp-content/uploads/2022/01/1.jpg\" style=\"height:338px; width:600px\" /></a></p>\r\n\r\n<p>&copy; Unsplash.com</p>\r\n\r\n<p>Nah, sebagai dunia virtual,&nbsp;<em>metaverse&nbsp;</em>adalah sebuah lingkungan yang menyediakan banyak opsi kegiatan bagi penggunanya.</p>\r\n\r\n<p>Hal ini terlihat dari inisiatif Meta dan Mark Zuckerberg untuk menjalin hubungan kerja sama dengan banyak perusahaan ternama.</p>\r\n\r\n<p>Namun, tak terpaut dengan kampanye perusahaan, ada banyak aktivitas lain yang bisa dilakukan masyarakat awam pada platform ini. Berikut adalah daftar dan penjelasannya.</p>\r\n\r\n<h3><strong>1. Konser virtual</strong></h3>\r\n\r\n<p>Salah satu hal yang bisa kamu lakukan dalam&nbsp;<em>metaverse&nbsp;</em>adalah menonton konser virtual.</p>\r\n\r\n<p>Seperti yang sudah Glints jelaskan, masyarakat bisa melakukan kegiatan di luar kampanye perusahaan.</p>\r\n\r\n<p>Salah satunya adalah menyaksikan konser virtual yang digelar dalam lingkungan&nbsp;<em>metaverse.</em></p>\r\n\r\n<p>Konsepnya hampir serupa dengan menonton konser secara langsung.&nbsp;</p>\r\n\r\n<p>Dengan bantuan teknologi, kamu akan merasakan suasana otentik konser bersama pengguna lain dalam&nbsp;<em>metaverse.&nbsp;</em>Menarik bukan?</p>\r\n\r\n<h3><strong>2. Melihat serta membeli karya seni dan pakaian</strong></h3>\r\n\r\n<p>Hal lainnya yang bisa lakukan di dalam&nbsp;<em>metaverse&nbsp;</em>adalah melihat serta membeli karya seni dan pakaian.</p>\r\n\r\n<p>Menurut&nbsp;<a href=\"https://www.wired.com/story/what-is-the-metaverse/\" rel=\"noopener\" target=\"_blank\">Wired</a>, sistem jual beli karya seni dalam&nbsp;<em>metaverse&nbsp;</em>hadir dalam bentuk&nbsp;<a href=\"https://glints.com/id/lowongan/nft-adalah/#.YdQCU2hBzrc\" rel=\"noopener\" target=\"_blank\">NFT</a>.</p>\r\n\r\n<p>Pengguna nanti bisa melihat dan membeli hak kepemilikan karya seni dari perusahaan atau seniman jika mereka tertarik.</p>\r\n\r\n<p>Tak hanya itu, pengguna juga bisa mencoba dan membeli pakaian secara langsung dari perusahaan.</p>\r\n\r\n<p>Pakaian ini nantinya dapat digunakan oleh avatar atau ditampilkan pada akun media sosial si pembeli.</p>\r\n\r\n<p>Konsep pakaian ini disebut juga sebagai&nbsp;<em>digital fashion,&nbsp;</em>dan sudah mulai diperjual belikan oleh banyak perusahaan pakaian ternama.</p>\r\n\r\n<h3><strong>3. Main gim</strong></h3>\r\n\r\n<p>Untuk pengguna yang gemar bermain gim,&nbsp;<em>metaverse&nbsp;</em>dapat menjadi platform yang cukup menyenangkan.</p>\r\n\r\n<p>Sebab, banyak perusahaan video gim ternama yang sudah bekerja sama dengan perusahaan milik Mark Zuckerberg tersebut.</p>\r\n\r\n<p>Di dalamnya, kamu bisa menikmati ragam permainan dari perusahaan layaknya Epic Games yang mengeluarkan Fortnite.</p>\r\n\r\n<p>Untuk bermain, kamu memerlukan teknologi khusus seperti&nbsp;<em>oculus rift&nbsp;</em>agar bisa &ldquo;masuk&rdquo; ke dunia virtual&nbsp;<em>metaverse.</em></p>\r\n\r\n<h3><strong>4. Bekerja&nbsp;</strong></h3>\r\n\r\n<p>Terakhir,&nbsp;<em>metaverse&nbsp;</em>adalah sebuah platform yang dapat digunakan perusahaan dan pengguna untuk bekerja.</p>\r\n\r\n<p>Melansir&nbsp;<a href=\"https://www.cnbcindonesia.com/tech/20211216163806-37-299867/mengenal-apa-itu-metaverse-dan-bagaimana-cara-kerjanya\" rel=\"noopener\" target=\"_blank\">CNBC</a>,&nbsp;<em>metaverse</em>&nbsp;bisa menjadi hal baru bagi pekerja yang terjebak dengan sistem&nbsp;<em>shift&nbsp;</em>kerja<em>&nbsp;work from home&nbsp;</em>di tengah pandemi Covid-19.&nbsp;</p>\r\n\r\n<p>Tak sekadar dapat melihat rekan kerja dan atasan seperti aplikasi&nbsp;<em>meeting online</em>, karyawan bisa langsung bergabung bersama di kantor virtual&nbsp;<em>metaverse.</em></p>\r\n\r\n<p>Facebook sendiri bahkan telah meluncurkan&nbsp;<em>software meeting</em>&nbsp;untuk&nbsp;<em>metaverse&nbsp;</em>yang disebut dengan Horizon Workrooms.</p>\r\n\r\n<p>Ia bisa digunakan dengan headset VR, kacamata AR, dan&nbsp;<em>oculus rift</em>&nbsp;supaya pekerja bisa merasa layaknya di kantor sungguhan.</p>\r\n\r\n<p>Menurut&nbsp;<a href=\"https://www.augustman.com/sg/gear/tech/what-is-metaverse-and-how-does-it-work/\" rel=\"noopener\" target=\"_blank\">Augustman</a>, banyak pengalaman lainnya yang dapat dimanfaatkan oleh pengguna dalam metaverse.</p>\r\n\r\n<p>Hal ini akan diutamakan karena Meta ingin menyediakan pengalaman penggunaan terbaik bagi masyarakat dan perusahaan.</p>\r\n\r\n<p>Pengguna juga nantinya akan memiliki kemampuan berteleportasi dari satu pengalaman ke pengalaman lainnya.&nbsp;</p>\r\n\r\n<p>Sebab, perusahaan-perusahaan baru akan terus bekerja sama dan mencari cara untuk bisa menghubungkan platform satu sama lain dalam metaverse.</p>\r\n\r\n<h2>Cara Kerja Metaverse</h2>\r\n\r\n<p><a href=\"https://glints.com/id/lowongan/wp-content/uploads/2020/10/bermain-vr-dan-ar-bersama-2.jpg\" target=\"_blank\"><img alt=\"\" src=\"https://glints.com/id/lowongan/wp-content/uploads/2020/10/bermain-vr-dan-ar-bersama-2.jpg\" style=\"height:346px; width:600px\" /></a></p>\r\n\r\n<p>Seperti penjelasan Glints di atas,&nbsp;<em>metaverse&nbsp;</em>adalah serba-serbi dunia internet yang dihadirkan dalam sebuah platform virtual.</p>\r\n\r\n<p>Pengguna pun dapat melakukan beragam aktivitas pada platform tersebut, mulai dari investasi hingga melaksanaan pekerjaan secara&nbsp;<em>remote,&nbsp;</em>layaknya di dunia nyata.</p>\r\n\r\n<p>Meskipun demikian, supaya bisa terjun ke dunia virtual&nbsp;<em>metaverse,&nbsp;</em>ada beberapa hal yang perlu kamu persiapkan.</p>\r\n\r\n<p>Pertama-tama,&nbsp;<em>metaverse</em>&nbsp;takkan pernah bisa lepas dari internet sebagai akses utamanya. Hal tersebut didukung oleh perkembangan teknologi yang kini semakin canggih.</p>\r\n\r\n<p>Selain itu, proses kerja dalam&nbsp;<em>metaverse</em>&nbsp;perlu didukung oleh berbagai perangkat modern yang mumpuni, seperti&nbsp;<em>headphone&nbsp;</em>dan kacamata AR atau VR.</p>\r\n\r\n<p>Keberadaan dua perangkat ini merupakan sebuah hal yang perlu dimiliki jika kamu ingin berkutat di dunia&nbsp;<em>metaverse&nbsp;</em>yang sudah serba virtual serta menggunakan sistem AR dan 3D.</p>\r\n\r\n<p>Dalam perkembangan&nbsp;<em>metaverse&nbsp;</em>sendiri, aneka produk yang menunjang sistem&nbsp;<em>augmented reality</em>&nbsp;(AR) dan&nbsp;<em>virtual reality</em>&nbsp;(VR) berpotensi untuk digunakan. Hal itu seperti tangan robot atau kacamata VR berteknologi tinggi.</p>\r\n\r\n<p>Berbagai pilihan perangkat ini nantinya diperlukan pengguna untuk membuat aktivitas di&nbsp;<em>metaverse&nbsp;</em>semakin terasa nyata dan mudah dieksekusi.</p>\r\n', 9, '0000-00-00', 301, 0);
