INSERT INTO `tb_artikel` (`id_artikel`, `artikel_title`, `artikel_timestamp`, `artikel_thumbnail`, `artikel_text`, `id_category`, `accepted_date`, `artikel_viewer`, `artikel_level`) VALUES (48, 'Asistensi Mengajar Universitas Negeri Malang di SMKN 1 Purwosari Kabupaten Pasuruan', '2024-03-01 22:46:10', '1686715259.JPG', '<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Pembelajaran adalah kegiatan yang melibatkan seseorang dalam upaya memperoleh pengetahuan, ketrampilan dan nilai-nilai</span></span> <span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">positif dengan menggunakan sumber belajar. Jika ditanya apa pengalaman terbaik kami?, kami akan menjawab menjadi guru dan terlibat </span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">dalam banyak kegiatan sekolah</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">. Dalam kegiatan menjadi seorang guru wal</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">a</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">upun masih berstatus sebagai Mahasiswa aktif kami dibantu dengan program Asistensi Mengajar atau bisa disebut AM. Apa itu Asistensi Mengajar?, Asistensi Mengajar adalah program yang dibuat pemerintah yang bertujuan untuk memberikan bekal mahasiswa aktif untuk terlibat dalam pembelajaran, kegiatan akademi</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">k</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">, non akademi</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">k</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">, dan administrasi sekolah. Dalam program pemerintah ini mahasiswa mendapat bimbingan dari dosen dari kampus, dan mendapat guru pamong dari pihak sekolah yang dipilih dalam kegiatan Asistensi Mengajar ini. Kegiatan ini wajib dilaksanakan selama 1 semester penuh. Program ini ber</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">manfaat</span></span> <span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">bagi</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> mahasiswa dengan cara mahasiswa dapat menkonversi SKS sebanyak 20 </span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">SKS</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">, termasuk kegiatan PPL dan KKN. </span></span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Melalui program Asistensi Mengajar ini juga memberikan mahasiswa </span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">wawasan </span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">bagaimana cara </span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">m</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">enyusun sebuah kegiatan pembelajaran mulai dari modul ajar, bagaimana cara mengkondisikan kelas, bagaimana berjalannya sekolah dari sudut pandang administrasi, dan betapa pentingnya kegiatan non akademik di ranah sekolah.&nbsp; Dari program ini kami menjadi lebih terampil, inovatif dan berkompeten</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">.</span></span> <span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">K</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">enapa bisa demikian? karena dalam program ini, mahasiswa mendapat kelas dan tugas yang bisa saja berubah sewaktu waktu bahkan kondisi yang tidak menentu. Kami juga mendapat pengalaman bagaimana cara mengelola kela</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">s</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> dengan baik agar siswa-siswi dapat tertarik dengan pembelajaran yang kami kembangkan secara inovatif dengan berbagai penyesuaian yang kami buat pula. </span></span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Adapun tujuan utama dari program Asistensi Mengajar antara lain :</span></span></span></span></p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Membantu </span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">p</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">elaksanaan kegiatan belajar mengajar di sekolah mitra</span></span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Membantu menyelesaikan permasalahan yang timbul selama pelaksanaan program Asistensi Mengajar</span></span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Turut serta dalam pelaksanakan kegiatan non akademik dan administrasi di sekolah mitra. </span></span></span></span></li>\r\n</ol>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">P</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">rogram ini dilaksanakan oleh mahasiswa secara berkelompok, dimana kelompok beranggotakan 6 mahasiswa yang dibimbing oleh dosen pembimbing lapangan</span></span> <span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">dan guru pamong. Kegiatan ini kami laksanakan di SMKN 1 Purwosari dengan berbagai kegiatan yang meliputi kegiatan akademik, non akademik, administrasi sekolah</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">,</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> dan publikasi.</span></span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Selama mengikuti Asistensi Mengajar banyak sekali pengalaman berharga yang kami peroleh, antara lain pengalaman mengajar di kelas, memanajemen diri, memanajemen waktu, hubungan so</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">s</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">ial, kepribadian serta sudut pandang terhadap permasalahan yang kami dapatkan. Dengan adanya program ini kami dapat melihat secara langsung lingkup kerja yang ada di sekolah SMKN 1 Purwosari. Sehingga hal tersebut dapat menjadi pengalaman langsung yang dapat kami rasakan dampaknya, serta bisa menjadi bekal yang cukup untuk terjun di dunia Pendidikan. Selain itu</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">,</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> dari program yang sudah kami laksanakan selama 1 semester ini kami melihat bahwasanya program ini juga membuka jalur bagi mahasiswa untuk menjalin relasi dengan guru</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">, </span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">siswa</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">, dan seluruh warga sekolah</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> dari SMKN 1 Purwosari. </span></span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Pada tahap awal dari program ini dibuka dengan proses perencanaan kegiatan </span></span></strong></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Pada tahap ini, kami diwajibka</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">n</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> untuk melakukan observasi sekolah, dimana teknis kegiatan ini mahasiswa diharuskan melihat kondisi lingkungan sekolah dan mengajukan surat tugas yang sudah diberikan oleh pihak kampus. Didalam kegiatan observasi ini kami juga sewajarnya memperkenalkan diri secara formal kepada</span></span> <span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">pihak sekolah serta menyatakan maksud kedatangan kelompok kami ke SMKN 1 Purwosari. Pada kegiatan ini kami juga diperkenalkan untuk pertama kalinya kepada guru pamong, antara lain adalah Bapak Lutfi dan Bapak </span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">R</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">adit selaku guru </span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">dan</span></span> <span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Kepala Kompetensi Keahlian</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> DKV dan RPL. Kami juga dikonfirmasikan oleh pihak sekolah bahwasanya kami bertanggung jawab untuk mengajar 2 jurusan antara lain DKV dan RPL. </span></span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Selanjutnya adalah pelaksanaan kegiatan &nbsp;</span></span></strong></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Pada tahap ini kami diharuskan untuk mulai mendiskusikan tentang kegiatan yang akan dilakukan dan output apa yang akan diberikan kepada pihak SMKN 1 Purwosari didampingi dengan bimbingan dosen pembimbing lapangan dari Prodi S1 Pendidikan Teknik Informatika. Tidak hanya melakukan perancangan, tapi menurut pengalaman dari kegiatan pelaksanaan ini, kami melakukan perencanaan diiringi dengan mulai melakukan kegiatan akademik yakni mengajar. Sedikit cerita, kami merancang modul ajar disiapkan seminggu sebelum kelas atau materi baru akan dikerjakan. Sehingga sudah siap melakukan kegiatan</span></span> <span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">pembelajaran pada minggu selanjutnya. </span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Di d</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">alam pelaksanaan kegiatan ini kami melakukan <em>Focus Group Discussion</em></span></span><em> </em><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">(FGD)</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> juga dengan guru pamong masing masing kelompok jurusan. Untuk kegiatan belajar mengajar kami dikarenakan kondisi so</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">sia</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">l yang sudah membaik dari penyebaran virus <em>corona</em>, sekolah SMKN 1 Purwosari sudah melakukan kegiatan belajar secara luring. Dalam tahap pelaksanaan kegiatan ini kami mendapat jam mengajar antara 10-14 jam per minggunya. Dengan adanya penugasan mengajar tersebut </span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">kami</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> berkewajiban</span></span> <span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">untuk merancang proses pembelajaran, menertibkan lingkungan kelas, mendidik dan mengarahkan peserta didik untuk siap bersaing di industri kedepannya. kelompok kami mencakup pengajaran antara lain X DKV 1, X DKV 2, X RPL , dan XII RPL. Sementara dari segi kesiapan pembelajaran kami menggunakan media LMS, Video, Modul belajar, dan PPT. materi yang disampaikan kepada peserta didik merupakan materi sesuai dengan ATP SMKN 1 Purwosari yang meliputi materi mengenai multimedia dan Rekayasa perangkat lunak. </span></span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Di setiap akhir pembelajaran kami mengadakan evaluasi sesuai denga</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">n </span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">apa yang kami pelajari dari mata kuliah <em>mi</em></span></span><em><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">c</span></span></em><em><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">roteaching</span></span></em><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">. Tujuan dari evaluasi ini adalah untuk <em>mer</em></span></span><em><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">e</span></span></em><em><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">view</span></span></em><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> dan mengetahui tingkat pemahaman peserta didik terkait materi yang telah di berikan. Untuk evaluasi kami menggunakan <em>quizziz</em>, dan <em>kahoot</em> sebagai medianya, mengapa demikian? Tidak tanpa alasan kami menggunakan <em>platform</em> tersebut, dari kedua <em>platf</em></span></span><em><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">or</span></span></em><em><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">m</span></span></em><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> tersebut telah mencakup g</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">a</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">mi</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">f</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">ikasi di dunia Pendidikan sehingga peserta didik bisa lebih rileks dan fresh. Tanpa alasan kami menggunakan g</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">a</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">mi</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">f</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">ikasi untuk <em>merileksk</em></span></span><em><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">an</span></span></em><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> kondisi dan </span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">m</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">ental siswa, karena kelompok kami mendapat jatah mengajar di jam-jam awal pembelajaran, sehingga rasa rileks harus disiapkan di akhir pembelajaran kami agar siswa bisa menerima mata pelajaran sesudah mata pelajaran yang kami b</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">i</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">mbing dengan lebih fresh dan fo</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">k</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">us. Kami sadar bahwa tekanan dari lamanya proses pembelajaran dari kurikulum terbaru dan tuntutan waktu <em>fullday </em>sangat berat bagi siswa sehingga kami mengambil jalan tengah memberikan media <em>quizziz</em> dan <em>kahoot</em> untuk menambah pengetahuan sekaligus membuat siswa lebih nyaman dalam menerima pembelajaran yang kami berikan</span></span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Terkait pelaksanaan UTS di SMKN 1 Purwosari, kami diperbolehkan masuk dalam proses pembuatan soal, </span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">melaksanakan </span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">ujian, serta menilai hasil kerja peserta didik. kami juga diajarkan untuk merekap semua hasil tugas peserta didik mulai dari pertemuan pertama hingga waktu menjelang UAS. Sebelum pekan UTS dilaksanakan, kami menyiapkan mulai dari konsultasi soal dan kisi-kisi peserta didik dengan bimbingan guru pamong. Beberapa dari kami juga memberikan remidi kepada peserta didik yang memiliki nilai kurang memuaskan. </span></span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Selain melakukan pembelajaran dan administrasi, kami juga bergerak di bidang non akademik berupa </span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">administrasi jurusan, administrasi perpustakaan, administrasi BK, kesiswaan, instalasi perangkat lunak, pembuatan media interaktif</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> hingga kegiatan ekstrakurikuler yang ada di SMKN 1 Purwosari. Masing- masing dari kami memegang tugas dan peranan masing masing dalam melaksanakan kegiatan non akademi</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">k. Selain kegiatan di atas kami di amanahi untuk membuat produk luaran AM berupa website penjualan produk dan jasa yang ada di SMKN 1 Purwosari.</span></span> </span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Pada kegiatan </span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">kesiswaan</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> kami diharuskan siap siaga di depan gerbang sekolah untuk mengecek peserta didik yang tidak menaati aturan terkait seragam dan perlengkapan penunjang sekolah lainnya. Sedangkan administrasi kami membantu merekap berkas dokumen UKK kelas XII RPL, absensi kehadiran peserta didik, membantu merekap data siswa di BK,</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> mendata dan menata buku perpustakaan,</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> merekap nilai peserta</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> UKK, dan lain-lain</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">. </span></span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Sekarang masuk pada tahap akhir pelaksanaan Asistensi Mengajar</span></span></strong></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Pada tahap ini M</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">ahasiswa membuat program kerja yakni sosialisasi U</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">I/UX</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> design yang dikhususkan untuk peserta didi</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">k</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> jurusan DKV</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> dan RPL</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">. Pada kegatan ini kami mengundang pemateri dari perusahaan <em>start up</em> yang sudah terkenal yakni</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> CV.</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">10</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">am studio </span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">yang bergera</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">k</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> di bidang </span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">UI/UX</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> design sejumlah 9 orang. Pada program kerja ini kami membagi pemateri yang berjumlah 9 orang ke dalam 4 kelas yang berbeda yang bertujuan untuk memeratakan dan menyingkat waktu pelaksanaan tetapi dengan tujuan dan output yang jelas, dan yah.. alhamdulillah program kerja kami sangat sukses</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">,</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> dimana banyak peserta didik yang termotivasi dan ingin m</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">engetahui lebih lanjut mengenai materi</span></span> <span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">UI/UX. Kenapa kami mengambil tema program kerja ini? Kami membuat program kerja ini dikarenakan masih awamnya UI/UX di ranah SMK khususnya DKV</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> dan RPL</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">, sedangkan dengan kemampuan design yang sangat mencukupi bisa menjadi tombak bagi peserta didik DKV</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> dan RPL</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">. </span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">D</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">iharap jurusa</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">n</span></span> <span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">DKV</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> dan RPL</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> juga bisa membantu pekerjaan </span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">pengembang perangkat lunak</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> sebagai </span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">UI/</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">UX engineer. Untuk output terakhir yang kami berikan adalah pembuatan Web yang </span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">dikembangkan</span></span> <span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">sebagai</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> rasa terimakasih kepada SMKN 1 Purwosari yang bersedia menerima mahasiswa aktif seperti kami dan membimbing kami sehingga mendapat pengalaman yang sangat menyenangkan dan memotivasi kami. Web kami adalah web marketplace yang bertujuan untuk membantu proses praktikum peser</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">ta</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> didik di semua bidang jurusan agar produk</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> dan jasa</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> yang dihasilkan dari kegiatan praktik bisa dijual dan menguntungkan untuk sekolah serta peserta didik, dari konteks tersebut kami percaya bahwa adanya web ini dapat meningkatkan rasa percaya diri peserta didik untuk berinovasi sekaligus berwirausaha. Dari hal tersebut kami beracuan kepada konsep sekolah kejuruan yang dimana peserta didik disiapkan untuk bisa bersaing di dunia kerja se dini mungkin, dari pegembangan web tersebut, peserta didik bisa memiliki 2 opsi antara lain bekerja di dunia industri ataupun berwirausaha, karena sudah memiliki pengalaman dan pemikiran yang kritis dalam berwirausaha Bersama sekolah SMKN 1 Purwosari.</span></span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Sebelum kegiatan Asistensi Mengajar diakhiri, terdapat kegiatan de</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">s</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">iminasi. Kegiatan ini bertujuan untuk memaparkan kegiatan yang telah dilakukan oleh mahasiswa elama pelaksanaan Asistensi Mengajar . setalah kegiatan ini terlaksana, kegiatan terakhir adalah penjemputan mahasiswa yang menjadi tanda berakhirnya kegiatan Asistensi Mengajar yang didampingi oleh dosen program studi S1 Pendidikan Teknik Informatika Universitas Negeri Malang. &nbsp;</span></span></span></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><img src=\"data:image/jpeg;base64,\" style=\"height:284px; width:504px\" /></span></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Sosialisasi UI/UX oleh CV.10am studio</span></span></span></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><img src=\"data:image/jpeg;base64,\" style=\"height:299px; width:531px\" /></span></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><img src=\"data:image/jpeg;base64,\" style=\"height:298px; width:529px\" /></span></span></p>\r\n', 5, '0000-00-00', 192, 0);
INSERT INTO `tb_artikel` (`id_artikel`, `artikel_title`, `artikel_timestamp`, `artikel_thumbnail`, `artikel_text`, `id_category`, `accepted_date`, `artikel_viewer`, `artikel_level`) VALUES (49, 'TUTORIAL MEMBUAT QRCODEMONKEY_MAPS LOKASI RUMAH', '2024-03-01 03:38:04', '1687647461.jpg', '<p style=\"text-align:center\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">TUTORIAL</span></span></strong></span></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">CARA MEMBUAT QR CODE MONKEY MENGGUNAKAN HP</span></span></strong></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">1. BUKA APLIKASI MAPS </span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">2. PILIH LOKASI RUMAH DAN TANDAI DENGAN PIN SEHINGGA MUNCUL KOORDINAT RUMAH </span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">3. BUKA BROWSER DAN KETIK qrcode-monkey.com/#maps </span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">4. MASUKKAN KOORDINAT YANG DIAMABIL DARI NOMOR 2 </span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">CONTOH: </span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">a. Latitude = -7.7475605 </span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">b. Longitude = 112.7221218 </span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">5. Klik CREATE QRCODE </span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">6. DOWNLOAD QRCODE DAN TEMPELKAN DI DENAH LOKASI PADA BUKU INDUK</span></span></span></span></p>\r\n', 7, '0000-00-00', 201, 0);
